import styled from 'styled-components'

export const StyledUl = styled.ul`
	background-color: #ececec;
	list-style-type: none;
	display: flex;
	flex-direction: column;
	row-gap: 1rem;
	`
	export const StyledLi = styled.li`
		list-style-type: none;
	`
